import React from "react";
import { useState } from "react";

function ZIndex() {
    const[zIndex, setZIndex] = useState(0);
    
    return (
        <div>
            <div className={zIndex} onClick={() => setZIndex(zIndex + 1)}></div>
        </div>
    )
}

export default ZIndex;
